import React, { useState } from "react";
import ApiService from "../../service/ApiService";

const PrediccionPage = () => {
  const [form, setForm] = useState({
    numAdultos: 2,
    numNinos: 1,
    tipoHabitacion: "Doble",
    precioHabitacion: 100.0,
    duracionEstadia: 3,
    diaSemanaCheckIn: "Friday",
    mesCheckIn: 4,
    antiguedadReserva: 60,
  });

  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const parsedValue =
      ["tipoHabitacion", "diaSemanaCheckIn"].includes(name) ? value : Number(value);
    setForm((prev) => ({
      ...prev,
      [name]: parsedValue,
    }));
  };

  const handlePredecir = async () => {
    try {
      setLoading(true);
      const res = await ApiService.predecirCancelacion(form);
      console.log("📦 Resultado completo de predicción:", res);

      // Adaptación robusta para diferentes estructuras:
      const cancelara = res?.cancelara ?? res?.resultado ?? null;
      const confianza = res?.confianza ?? res?.probabilidad ?? null;

      setResultado({
        cancelara,
        confianza,
        raw: res,
      });
    } catch (error) {
      alert("Error al obtener la predicción.");
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-4 max-w-xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">🔮 Predicción de Cancelación</h1>

      <form className="space-y-3">
        <div className="grid grid-cols-2 gap-4">
          {[
            { name: "numAdultos", label: "Número de Adultos", type: "number" },
            { name: "numNinos", label: "Número de Niños", type: "number" },
            { name: "precioHabitacion", label: "Precio de Habitación", type: "number", step: "0.01" },
            { name: "duracionEstadia", label: "Duración de Estancia (días)", type: "number" },
            { name: "mesCheckIn", label: "Mes del Check-In", type: "number", min: "1", max: "12" },
            { name: "antiguedadReserva", label: "Antigüedad de la Reserva (días)", type: "number" },
          ].map(({ name, label, ...rest }) => (
            <div key={name}>
              <label className="block text-sm font-medium">{label}</label>
              <input
                name={name}
                value={form[name]}
                onChange={handleChange}
                className="border p-2 rounded w-full"
                {...rest}
              />
            </div>
          ))}

          <div>
            <label className="block text-sm font-medium">Tipo de Habitación</label>
            <select
              name="tipoHabitacion"
              value={form.tipoHabitacion}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            >
              {["Doble", "Simple", "Suite"].map((tipo) => (
                <option key={tipo} value={tipo}>
                  {tipo}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium">Día del Check-In</label>
            <select
              name="diaSemanaCheckIn"
              value={form.diaSemanaCheckIn}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            >
              {["Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"].map((dia) => (
                <option key={dia} value={dia}>
                  {dia}
                </option>
              ))}
            </select>
          </div>
        </div>

        <button
          type="button"
          onClick={handlePredecir}
          className="bg-teal-700 text-white px-4 py-2 rounded w-full mt-4"
          disabled={loading}
        >
          {loading ? "Procesando..." : "Predecir Cancelación"}
        </button>
      </form>

      {resultado && (
  <div className="mt-6 p-4 border rounded bg-gray-100 text-center">
    {resultado.cancelara === true && (
      <p className="text-lg font-semibold text-red-600">❌ Cancelará la reserva</p>
    )}
    {resultado.cancelara === false && (
      <p className="text-lg font-semibold text-green-600">✅ No cancelará la reserva</p>
    )}
    {resultado.cancelara === null && (
      <p className="text-lg font-semibold text-gray-600">❓ Resultado no reconocido</p>
    )}

    {resultado.confianza !== null && (
      <p className="text-sm text-gray-800 mt-2">
        Confianza del modelo: <strong>{Math.round(resultado.confianza * 100)}%</strong>
      </p>
    )}
  </div>
)}

    </div>
  );
};

export default PrediccionPage;
